import { makeStyles } from '@material-ui/core';
import React from 'react';
import './../css/fonts.css';
import Navegation from './Navegation';
import Return from './Return';


const useStyles = makeStyles(()=>({
    dataContainer:{
        background:'red',
        margin:'80px 0 0  85px ',
        width:'100%',
        display:'flex',
        flexDirection:'column'
    },
    titleElection:{
        margin:'20px 0 0',
        textAlign:'center',
        fontSize:'40px',
        fontFamily: 'Rubik, sans-serif',
        fontWeight:'bold'
    },
    dataMember:{
        width:'80%',
        background:'green',
        margin:'20px auto 0',
        border:'1px solid #5A2120'
    }
}));

const Member = () => {
  const classes = useStyles();
  return (
      <React.Fragment>
        <Navegation />
        <div className={classes.dataContainer}>
            <div className={classes.titleElection}>ELECCIONES RECTORALES 2021</div>

            <div className={classes.dataMember}>HOLSSSSSSSSSSS</div>

            <div className={classes.returnCont}><Return /></div>
        </div>
      </React.Fragment>
    
  );
}

export default Member;
